//    It will take several generations for NFTs to be fully adopted. Those who were raised in an era prior to ideas of digital ownership are less likely to appreciate the concepts of blockchain. Those who were raised in an era following these ideas of internet, digital ownership, digital forms of communication will acknowledge decentralized tokens as a reality. It is up to them to decide if they agree with what they stand for or not. Sentiment can be positive or can be negative, adoption does not care for sentiment as long as it is recognized these tokens are a reality society has accepted. However, by the time the entire world in all age ranges appreciates the idea of digital ownership and tokenized assets, NFTs will become the norm. The true action takes place in the fight for adoption, not once it has been met. The fun is now.                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            //
